import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const errorPage = () => {
  return (
    <div>
      <h1>Oops, something went wrong</h1>
      <p>
        Try
        <Link href='/'>
          <a>goingf back</a>
        </Link>
      </p>
    </div>
  );
};

export default errorPage;
